import React from 'react';

function App() {
  return (
    <form>
        <input type="text" placeholder="Título"></input>
        <textarea placeholder="Escreva sua nota.."></textarea>
        <button>Criar nota</button>

        <ul>
            <li>
                <section>
                    <header>
                    <h3>Título</h3>
                    <p>Escreva sua nota</p>
                    </header>
                </section>
            </li>
        </ul>
    </form>
  );
}

export default App;
